import homepageImg from "./assets/homepage.jpeg";
import "./HomePage.css"

function HomePage() {
  return (
    <div>
      <main className="d-flex ">
        <section>
          <div>linha vermelha</div>
          <h1>Have Gift ideas for this Xmas</h1>
          <p>put a little of yourself in your gifts. here you will find great ideas for gifting your loved ones in a creative and different way. try to get your hands dirty and be amazed. gift it yourself!</p>
          <button type="button" className="btn btn-dark rounded-pill">click here</button>
        </section>

        <section>
          <img className="w-25" src={homepageImg} alt="gift-wrapped" />
          <div className="black-line"></div>
          <div>linha vermelha</div>
        </section>
      </main>
    </div>
  );
}

export default HomePage;
